import React, { Component } from 'react';
import "./home.css";


export default class Home extends Component {

    render() {
      return (
        <div id="Home-content">
            <div id="Home-picture"/> 
            <div>
                <p>Mere robust fysiskt og psykiskt</p>
                <p>Mere overskud i hverdagen</p>
            </div>
        </div>

      );
    }
}
